import { Application, Button } from 'react-rainbow-components';
import { useTheme } from "@mui/material";
import { tokens } from "../theme";




const Search = () => {
    
    const Mytheme = useTheme();
    const colors = tokens(Mytheme.palette.mode);
    const theme = {
        rainbow: {
            palette: {
                brand: colors.greenAccent[600],
            },
        },
    };
    return (
        <div className="dash" style={{ paddingLeft: '20px' }}>
            <h1>Search</h1>
            <Application theme={theme} className='TEST-CHANGE-COLOR'>
            <Button label="Hello World!" variant="brand" onClick={() => alert('Hello World!')} />
            </Application>
        </div>
    )
}

export default Search;
